import { Link } from "react-router-dom";
import { AiFillHome } from "react-icons/ai";
import {SideBarContainer, SideNavBar, SideNavItem} from './StyledComponents'

const SideBar = () => (
  <SideBarContainer>
    <SideNavBar>
      <Link><SideNavItem>
          <AiFillHome/>

      </SideNavItem></Link>
    </SideNavBar>
  </SideBarContainer>
)
export default SideBar
